tables.table_schema:
CREATE TABLE influencer_metrics (
    influencer_id INT PRIMARY KEY,
    influencer_name VARCHAR(50),
    followers INT,
    engagement_rate FLOAT
);

CREATE TABLE brand_metrics (
    brand_id INT PRIMARY KEY,
    brand_name VARCHAR(50),
    total_engagement_count INT,
    total_influencers_reached INT
);

CREATE TABLE brands (
    brand_id INT PRIMARY KEY,
    brand_name VARCHAR(50),
    industry VARCHAR(50),
    location VARCHAR(50)
);
